/***** GENERAL STYLES *****/

body {
  width: 90%;
  margin: 0 auto;
  max-width: 1200px;
  background: lightblue
    url("https://images.pexels.com/photos/912110/pexels-photo-912110.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1")
    no-repeat fixed center;
  background-size: cover;
  font-family: "Roboto", sans-serif;
  color: rgba(53, 72, 94, 255);
}

h1,
h2 {
  font-family: "Varela Round", sans-serif;
}

h2,
p {
  margin: 0;
}

section {
  background: rgba(255, 255, 255, 0.8);
  margin: 30px;
  border-radius: 30px;
}

section > h2 {
  margin-top: 20px;
}

/***** HEADER *****/

header {
  display: flex;
  justify-content: space-around;
  align-items: center;
  position: fixed;
  height: 75px;
  top: 0;
  left: 0;
  background: #ffffff;
  width: 100%;
  z-index: 1;
}

.logo {
  width: 20%;
  display: flex;
}

#header-img {
  width: 100%;
  height: auto;
  max-width: 250px;
}

ul {
  display: flex;
  list-style-type: none;
  justify-content: space-evenly;
  padding: 0;
}

#header ul li {
  font-family: "Varela Round", sans-serif;
  text-transform: uppercase;
  font-size: 1em;
}

a {
  text-decoration: none;
  color: rgba(53, 72, 94, 255);
  font-weight: 800;
}

nav#nav-bar {
  width: 50%;
}

/***** FOOTER *****/
footer {
  margin-bottom: 30px;
  width: 100%;
}

footer ul {
  display: flex;
  justify-content: flex-end;
  margin: 0;
}

footer ul li {
  padding: 0 10px;
}

footer span {
  display: flex;
  justify-content: flex-end;
  font-size: 0.9em;
}

footer a {
  font-weight: 400;
}

/***** HERO FORM *****/

.form-section {
  margin-top: 100px;
  margin-bottom: 30px;
}

section.form-section {
  display: flex;
  align-content: center;
  justify-content: center;
}

.form {
  width: 60vw;
  max-width: 500px;
  min-width: 300px;
  margin: 0 auto;
  padding: 0 0 25px 0;
  border-radius: 5px;
}

.form h1 {
  text-align: center;
  margin: 20px 0 5px 0;
}

form#form {
  text-align: center;
}

fieldset {
  border: none;
  padding: 20px 0;
}

input#email {
  width: 60%;
  min-height: 1.5em;
  color: rgba(53, 72, 94, 255);
  font-family: inherit;
  border-radius: 5px;
  font-size: 18px;
}

input#submit {
  width: 20%;
  min-height: 1em;
  color: white;
  font-family: "Varela Round", sans-serif;
  border-radius: 5px;
  font-size: 18px;
  border: none;
  background: rgba(239, 131, 58, 255);
  padding: 5px;
}

/***** FEATURES *****/
#features {
  margin-top: 30px;
}

.grid {
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 5px 0 0 0;
}

.grid h2 {
  margin-top: 20px;
}

.grid p:last-child {
  padding-bottom: 20px;
}

.feature-info {
  display: flex;
  width: 75%;
  flex-wrap: wrap;
}

i.fa-solid.fa-champagne-glasses,
i.fa-solid.fa-people-group,
i.fa-solid.fa-mountain-sun {
  font-size: 2.5rem;
  color: rgba(46, 126, 116, 255);
}

.icon {
  display: flex;
  align-items: center;
  height: 125px;
  width: 25vh;
  justify-content: center;
}

#features div:first-child {
  margin-top: 20px;
}

p {
  padding: 0 45px 0 0;
}

h2 {
  margin: 0 0 5px 0;
}

/***** THE BALLOONS *****/

#the-balloons {
  display: flex;
  justify-content: center;
}

iframe#video {
  margin: 25px 0;
}

/***** LOCATIONS *****/

section#locations {
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
}

section > h2,
section > p {
  margin-top: 2 0px;
  width: 100%;
  text-align: center;
}

/***** LOCATIONS *****/

/* (B) RESPONSIVE IMAGE */
.textover img {
  width: 100%;
  height: 100%;
}
.textover {
  max-width: 400px;
}

/* (C) POSITION CAPTION */
.textover {
  position: relative;
} /* REQUIRED */
.textover figcaption {
  position: absolute;
  bottom: 0;
  left: 0;
}

/* (D) CAPTION COSMETICS */
.textover figcaption {
  box-sizing: border-box;
  width: 100%;
  padding: 10px;
  color: white;
  text-align: center;
  background: rgba(37, 150, 190, 0.6);
  text-transform: uppercase;
}

#locations {
  padding: 0 0 20px 0;
}

/***** PRICING *****/

section#pricing {
  background: none;
}
.pricing-div {
  display: flex;
}

.price-box {
  display: flex;
  width: 33.33%;
  padding: 0 0 20px 0;
  flex-direction: column;
  align-items: center;
  text-align: center;
  border-radius: 15px;
  margin: 0 10px;
  background: rgba(255, 255, 255, 0.8);
}

.price-box p {
  padding: 0 20px 20px 20px;
}

.price-box h3 {
  text-transform: uppercase;
  box-sizing: border-box;
  width: 100%;
  border-radius: 15px 15px 0 0;
  padding: 10px 0;
  margin: 0;
  color: white;
  text-align: center;
  background: rgb(37, 150, 190);
  letter-spacing: 0.15em;
}

.price-box h2 {
  padding: 10px 0;
}

button {
  padding: 10px 20px;
  text-transform: uppercase;
  font-family: "Varela Round", sans-serif;
  font-weight: 800;
  background: rgba(239, 131, 58, 255);
  color: white;
  border: none;
  letter-spacing: 0.15em;
  border-radius: 3px;
}

button:hover,
input#submit:hover {
  background: rgb(37, 150, 190);
  cursor: pointer;
}

/***** TABLETS *****/

@media only screen and (max-width: 768px) {
  nav#nav-bar {
    width: 65%;
  }
}

/***** MOBILE *****/

@media only screen and (max-device-width: 480px) {
  header {
    display: flex;
    height: 200px;
    flex-wrap: wrap;
  }

  .logo {
    width: 100%;
    justify-content: center;
  }

  nav#nav-bar {
    width: 65%;
  }

  ul {
    flex-wrap: wrap;
  }

  #header ul li {
    width: 100%;
    text-align: center;
    line-height: 1.5em;
  }

  /***** FORM *****/

  .form-section {
    margin-top: 230px;
  }

  input#email {
    width: 85%;
  }

  input#submit {
    width: 40%;
  }

  /***** THE BALLOONS *****/

  section#the-balloons {
    background: none;
  }

  /***** PRICING *****/

  .pricing-div {
    flex-wrap: wrap;
  }

  .price-box {
    width: 100%;
    border-radius: 30px;
    margin: 20px 0px;
  }

  .price-box h3 {
    border-radius: 30px 30px 0 0;
  }

  price-box-1 {
    margin-top: 0;
  }

  /***** FOOTER *****/

  .footer-info {
    flex-wrap: wrap;
  }

  footer ul {
    justify-content: center;
    width: 100%;
  }

  footer span {
    justify-content: center;
    width: 100%;
    margin-top: 5px;
  }
}

